УНИКАЛЬНОЕ ОФОРМЛЕНИЕ.
.
.
Каждое свадебное оформление уникально, как и каждая пара, для которой он создается. Начиная подготовку к свадьбе, помимо выбора площадки и составления списка гостей, стоит озадачиться составлением пожеланий для декоратора - какая рассадка гостей планируется, необходимо ли оформление церемонии, фото- и велкам-зоны и конечно же стола молодоженов. О последнем хочется сказать следующее. Отдельный стол молодоженов нужен в следующих случаях:
1. Вы сами хотите выделить свой стол в зале;
2. Большой зал и большое количество столов выбранной вами площадки требуют выделения главной зоны;
3. Отсутсвие церемониальной или фотозоны (основные красивые фотографии молодоженов на торжестве тогда приходятся на зону президиума).
От президиума стоит отказаться, если:
1. У вас небольшой бюджет свадьбы (отличный способ сэкономить 20-40% от бюджета декора);
2. Вы запланировали камерную свадьбу с маленькое количество гостей (рассадка подразумевает общий длинный стол);
3. Вы не хотите отделять себя от гостей, хотите больше уюта и контакта с близкими в этот день.
